INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 450, 14, "みやこ", 0, 0, 0, "2025/12/31 11:59:59", 119901, 1, "2025/12/21 12:00:00", 119901, 119901, 302, 0, 0, 2.17, 1, 1, 0, 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, "ミヤコ（クリスマス）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 6, "しずる", 0, 0, 0, "2025/03/15 14:59:59", 120001, 1, "2025/03/10 12:00:00", 120001, 120001, 190, 0, 0, 2.375, 5, 1, 0, 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, "シズル（ノワール）");
