INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 1, "しぇふぃ", 0, 0, 0, "2026/01/31 11:59:59", 120701, 1, "2026/01/15 12:00:00", 120701, 120701, 283, 0, 0, 1.84, 22, 1, 0, 120701, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, "シェフィ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 4, 450, 2, "るか", 0, 0, 0, "2030/12/31 15:00:00", 120801, 1, "2023/10/16 15:00:00", 120801, 120801, 193, 0, 0, 1.3, 22, 1, 0, 120801, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, "ルカ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 12, "いりや", 0, 0, 0, "2026/01/31 11:59:59", 120901, 1, "2026/01/15 12:00:00", 120901, 120901, 424, 0, 0, 1.425, 38, 2, 0, 120901, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 0, "イリヤ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 1, "ぺこりーぬ", 0, 0, 0, "2025/02/24 11:59:59", 121001, 1, "2025/02/20 12:00:00", 121001, 121001, 164, 0, 0, 2.25, 41, 1, 0, 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, "ペコリーヌ（オーバーロード）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 1, "きゃる", 0, 0, 0, "2025/02/24 11:59:59", 121101, 1, "2025/02/20 12:00:00", 121101, 121101, 588, 0, 0, 2.07, 42, 2, 0, 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, "キャル（オーバーロード）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 4, 450, 6, "らびりすた", 0, 0, 0, "2030/12/31 15:00:00", 121201, 1, "2023/11/16 15:00:00", 121201, 121201, 260, 0, 0, 1.55, 40, 1, 0, 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, "ラビリスタ（オーバーロード）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 3, "くるみ", 0, 0, 0, "2030/12/31 15:00:00", 121301, 0, "2022/03/03 19:00:00", 121301, 121301, 731, 0, 0, 1.9, 3, 1, 0, 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, "クルミ（ステージ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 15, "みさき", 0, 0, 0, "2030/12/31 15:00:00", 121401, 0, "2022/03/15 15:00:00", 121401, 121401, 742, 0, 0, 2.27, 7, 2, 0, 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, "ミサキ（ステージ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 6, 450, 12, "あゆみ", 0, 0, 0, "2025/04/30 11:59:59", 121501, 1, "2025/04/26 12:00:00", 121501, 121501, 590, 0, 0, 2.0, 6, 1, 0, 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, "アユミ（怪盗）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 17, "いのり", 0, 0, 0, "2030/12/31 15:00:00", 121601, 0, "2022/04/15 15:00:00", 121601, 121601, 292, 0, 0, 1.425, 3, 1, 0, 121601, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, "イノリ（怪盗）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 0, 0, "あきの", 0, 180901, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 121701, 421, 0, 0, 0.0, 0, 0, 0, 121701, "", 1, "アキノ（アキノ＆サレン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 0, 0, "されん", 0, 180901, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 121801, 421, 0, 0, 0.0, 0, 0, 0, 121801, "", 1, "サレン（アキノ＆サレン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 12, "あんな", 0, 0, 0, "2030/12/31 15:00:00", 121901, 0, "2022/05/15 15:00:00", 121901, 121901, 293, 0, 0, 2.125, 5, 2, 0, 121901, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, "アンナ（パイレーツ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 14, "しのぶ", 0, 0, 0, "2030/12/31 15:00:00", 122001, 0, "2022/05/03 19:00:00", 122001, 122001, 380, 0, 0, 1.425, 3, 1, 0, 122001, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, "シノブ（パイレーツ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 35, 450, 9, "あおい", 0, 0, 0, "2030/12/31 15:00:00", 122101, 1, "2024/04/18 15:00:00", 122101, 122101, 731, 0, 0, 1.97, 35, 1, 0, 122101, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 0, "アオイ（キャンプ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 8, "ゆかり", 0, 0, 0, "2030/12/31 15:00:00", 122201, 0, "2022/05/31 12:00:00", 122201, 122201, 419, 0, 0, 1.84, 4, 1, 0, 122201, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, "ユカリ（キャンプ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 43, 450, 0, "うぁんぴぃ", 0, 0, 0, "2030/12/31 15:00:00", 122301, 0, "2022/06/15 15:00:00", 122301, 122301, 564, 0, 0, 1.425, 43, 2, 0, 122301, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, "ヴァンピィ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 1, 450, 8, "ひより", 0, 0, 0, "2030/12/31 15:00:00", 122401, 1, "2024/06/17 15:00:00", 122401, 122401, 264, 0, 0, 2.42, 1, 1, 0, 122401, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 0, "ヒヨリ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "れい", 0, 0, 0, "2025/08/31 11:59:59", 122501, 1, "2025/08/22 12:00:00", 122501, 122501, 250, 0, 0, 1.965, 4, 1, 0, 122501, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 0, "レイ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ゆい", 0, 0, 0, "2030/12/31 15:00:00", 122601, 0, "2022/07/15 15:00:00", 122601, 122601, 554, 0, 0, 2.27, 7, 2, 0, 122601, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, "ユイ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "きょうか", 0, 0, 0, "2030/12/31 15:00:00", 122701, 0, "2022/08/15 15:00:00", 122701, 122701, 812, 0, 0, 1.92, 7, 2, 0, 122701, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, "キョウカ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 1, 450, 0, "みそぎ", 0, 0, 0, "2030/12/31 15:00:00", 122801, 1, "2024/07/16 15:00:00", 122801, 122801, 237, 0, 0, 2.295, 1, 1, 0, 122801, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 0, "ミソギ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "みみ", 0, 0, 0, "2025/08/31 11:59:59", 122901, 1, "2025/08/22 12:00:00", 122901, 122901, 361, 0, 0, 2.25, 5, 1, 0, 122901, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 0, "ミミ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 44, 450, 0, "あめす", 0, 0, 0, "2026/01/03 11:59:59", 123001, 1, "2025/12/31 12:00:00", 123001, 123001, 746, 0, 0, 2.27, 44, 2, 0, 123001, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 0, "アメス");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "まほ", 0, 0, 0, "2030/12/31 15:00:00", 123101, 0, "2022/09/03 19:00:00", 123101, 123101, 793, 0, 0, 1.795, 7, 2, 0, 123101, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, "マホ（エクスプローラー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 0, "あやね", 0, 0, 0, "2030/12/31 15:00:00", 123201, 0, "2022/09/15 15:00:00", 123201, 123201, 256, 0, 0, 1.425, 3, 1, 0, 123201, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, "アヤネ（エクスプローラー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 450, 0, "ねあ", 0, 0, 0, "2025/09/30 11:59:59", 123301, 1, "2025/09/16 15:00:00", 123301, 123301, 350, 0, 0, 1.62, 0, 1, 0, 123301, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, "ネア");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 0, 0, "じゅん", 0, 0, 0, "2030/12/31 15:00:00", 0, 0, "2015/04/01 15:00:00", 0, 123401, 0, 0, 0, 0.0, 5, 0, 0, 123401, "", 0, "ジュン（キャンプ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 6, 450, 0, "りん", 0, 0, 0, "2030/12/31 15:00:00", 123501, 1, "2024/09/17 15:00:00", 123501, 123501, 583, 0, 0, 2.34, 6, 1, 0, 123501, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 0, "リン（ハロウィン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "とも", 0, 0, 0, "2025/11/30 11:59:59", 123601, 1, "2025/11/14 15:00:00", 123601, 123601, 262, 0, 0, 1.965, 4, 1, 0, 123601, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 0, "トモ（ハロウィン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ななか", 0, 0, 0, "2030/12/31 15:00:00", 123701, 0, "2022/10/15 15:00:00", 123701, 123701, 741, 0, 0, 2.07, 21, 2, 0, 123701, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, "ナナカ（ハロウィン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 450, 0, "くりすてぃーな", 0, 0, 0, "2025/11/14 14:59:59", 123801, 1, "2025/11/03 12:00:00", 123801, 123801, 238, 0, 0, 2.295, 1, 1, 0, 123801, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 0, "クリスティーナ（ワイルド）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 2, 450, 0, "まつり", 0, 0, 0, "2030/12/31 15:00:00", 123901, 0, "2022/11/15 15:00:00", 123901, 123901, 183, 0, 0, 2.125, 2, 1, 0, 123901, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, "マツリ（ワイルド）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "あかり", 0, 0, 0, "2025/12/31 11:59:59", 124001, 1, "2025/12/21 12:00:00", 124001, 124001, 438, 0, 0, 2.07, 7, 2, 0, 124001, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 0, "アカリ（クリスマス）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 6, 450, 0, "より", 0, 0, 0, "2030/12/31 15:00:00", 124101, 1, "2024/11/16 15:00:00", 124101, 124101, 433, 0, 0, 1.965, 6, 2, 0, 124101, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 0, "ヨリ（クリスマス）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "じゅん", 0, 0, 0, "2030/12/31 15:00:00", 124201, 0, "2022/12/23 12:00:00", 124201, 124201, 144, 0, 0, 2.07, 5, 1, 0, 124201, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, "ジュン（クリスマス）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 0, 0, "あん", 0, 181001, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 124301, 577, 0, 0, 0.0, 0, 0, 0, 124301, "", 1, "アン（アン＆グレア）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 0, 0, "ぐれあ", 0, 181001, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 124401, 577, 0, 0, 0.0, 0, 0, 0, 124401, "", 1, "グレア（アン＆グレア）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ほまれ", 0, 0, 0, "2026/01/31 11:59:59", 124501, 1, "2026/01/15 12:00:00", 124501, 124501, 707, 0, 0, 2.07, 21, 2, 0, 124501, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 0, "ホマレ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "みさと", 0, 0, 0, "2026/01/31 11:59:59", 124601, 1, "2026/01/15 12:00:00", 124601, 124601, 698, 0, 0, 2.44, 21, 2, 0, 124601, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 0, "ミサト（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 7, 450, 0, "みつき", 0, 0, 0, "2030/12/31 15:00:00", 124701, 1, "2024/12/16 15:00:00", 124701, 124701, 590, 0, 0, 2.24, 46, 1, 0, 124701, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 0, "ミツキ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "のぞみ", 0, 0, 0, "2025/02/24 11:59:59", 124801, 1, "2025/02/20 12:00:00", 124801, 124801, 423, 0, 0, 2.14, 0, 1, 0, 124801, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, "ノゾミ（リベレイター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 1, 450, 0, "かや", 0, 0, 0, "2030/12/31 15:00:00", 124901, 1, "2025/01/16 15:00:00", 124901, 124901, 170, 0, 0, 1.965, 0, 1, 0, 124901, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, "カヤ（リベレイター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "むいみ", 0, 0, 0, "2025/02/24 11:59:59", 125001, 1, "2025/02/20 12:00:00", 125001, 125001, 221, 0, 0, 1.965, 0, 1, 0, 125001, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, "ムイミ（リベレイター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 8, 450, 0, "たまき", 0, 0, 0, "2030/12/31 15:00:00", 125101, 0, "2023/03/03 19:00:00", 125101, 125101, 825, 0, 0, 2.24, 47, 1, 0, 125101, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, "タマキ（カフェ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "もにか", 0, 0, 0, "2030/12/31 15:00:00", 125201, 0, "2023/03/10 12:00:00", 125201, 125201, 463, 0, 0, 1.965, 4, 1, 0, 125201, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, "モニカ（カフェ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 6, 450, 0, "こっころ", 0, 0, 0, "2025/04/30 11:59:59", 125301, 1, "2025/04/26 12:00:00", 125301, 125301, 752, 0, 0, 2.07, 6, 1, 0, 125301, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 0, "コッコロ（レンジャー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 8, 450, 0, "しおり", 0, 0, 0, "2030/12/31 15:00:00", 125401, 0, "2023/04/10 12:00:00", 125401, 125401, 710, 0, 0, 2.09, 8, 1, 0, 125401, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, "シオリ（レンジャー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "じーた", 0, 0, 0, "2025/05/31 11:59:59", 125501, 1, "2025/05/15 15:00:00", 125501, 125501, 443, 0, 0, 1.92, 50, 2, 0, 125501, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 0, "ジータ（ウォーロック）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 51, 450, 0, "びから", 0, 0, 0, "2025/05/31 11:59:59", 125601, 1, "2025/05/15 15:00:00", 125601, 125601, 267, 0, 0, 2.09, 0, 1, 0, 125601, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, "ビカラ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 7, 450, 0, "かりん", 0, 0, 0, "2030/12/31 15:00:00", 125701, 1, "2025/04/16 15:00:00", 125701, 125701, 579, 0, 0, 2.24, 9, 2, 0, 125701, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 0, "カリン（アルケミスト）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 0, "りり", 0, 0, 0, "2030/12/31 15:00:00", 125801, 0, "2023/04/17 12:00:00", 125801, 125801, 464, 0, 0, 2.09, 0, 1, 0, 125801, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, "リリ（フォールン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, "かや", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 125901, 0, 0, 0, 0.0, 1, 0, 0, 125901, "", 0, "カヤ（リベレイター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 450, 0, "くりあ", 0, 0, 0, "2030/12/31 15:00:00", 126001, 0, "2023/10/31 12:00:00", 126001, 126001, 406, 0, 0, 2.09, 0, 1, 0, 126001, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, "クリア（フォールン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 44, 450, 0, "ぷれしあ", 0, 0, 0, "2030/12/31 15:00:00", 126101, 0, "2023/11/15 15:00:00", 126101, 126101, 480, 0, 0, 2.09, 53, 2, 0, 126101, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, "プレシア（フォールン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 3, 450, 0, "いりや", 0, 0, 0, "2025/06/20 11:59:59", 126201, 1, "2025/06/10 12:00:00", 126201, 126201, 568, 0, 0, 2.09, 3, 2, 0, 126201, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 0, "イリヤ（儀装束）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ゆき", 0, 0, 0, "2030/12/31 15:00:00", 126301, 0, "2023/06/15 15:00:00", 126301, 126301, 456, 0, 0, 2.07, 9, 2, 0, 126301, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, "ユキ（儀装束）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 450, 0, "くろーちぇ", 0, 0, 0, "2026/01/03 11:59:59", 126401, 1, "2025/12/31 12:00:00", 126401, 126401, 373, 0, 0, 2.09, 1, 1, 0, 126401, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 0, "クローチェ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "らいらえる", 0, 0, 0, "2026/01/03 11:59:59", 126501, 1, "2025/12/31 12:00:00", 126501, 126501, 740, 0, 0, 1.965, 0, 2, 0, 126501, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, "ライラエル");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ねねか", 0, 0, 0, "2025/08/15 14:59:59", 126601, 1, "2025/08/10 12:00:00", 126601, 126601, 650, 0, 0, 2.04, 7, 2, 0, 126601, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 0, "ネネカ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 5, 450, 0, "あきの", 0, 0, 0, "2030/12/31 15:00:00", 126701, 1, "2025/06/17 15:00:00", 126701, 126701, 224, 0, 0, 1.965, 5, 1, 0, 126701, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 0, "アキノ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "ゆかり", 0, 0, 0, "2030/12/31 15:00:00", 126801, 0, "2023/07/15 15:00:00", 126801, 126801, 159, 0, 0, 1.97, 5, 1, 0, 126801, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, "ユカリ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "らんふぁ", 0, 0, 0, "2025/08/31 11:59:59", 126901, 1, "2025/08/22 12:00:00", 126901, 126901, 682, 0, 0, 1.965, 21, 2, 0, 126901, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 0, "ランファ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 2, 450, 0, "くうか", 0, 0, 0, "2030/12/31 15:00:00", 127001, 1, "2025/07/16 15:00:00", 127001, 127001, 133, 0, 0, 1.97, 52, 1, 0, 127001, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 0, "クウカ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "しのぶ", 0, 0, 0, "2025/08/31 11:59:59", 127101, 1, "2025/08/22 12:00:00", 127101, 127101, 255, 0, 0, 2.09, 46, 1, 0, 127101, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 0, "シノブ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "きゃる", 0, 0, 0, "2025/09/30 11:59:59", 127201, 1, "2025/09/16 15:00:00", 127201, 127201, 804, 0, 0, 2.09, 7, 2, 0, 127201, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 0, "キャル（編入生）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 8, 450, 0, "すずな", 0, 0, 0, "2030/12/31 15:00:00", 127301, 0, "2023/09/15 15:00:00", 127301, 127301, 750, 0, 0, 2.09, 8, 1, 0, 127301, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, "スズナ（編入生）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, "びから", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 127401, 0, 0, 0, 0.0, 1, 0, 0, 127401, "", 0, "ビカラ（コラボ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "されん", 0, 0, 0, "2024/11/18 11:59:59", 127501, 1, "2024/11/11 12:00:00", 127501, 127501, 304, 0, 0, 2.09, 4, 1, 0, 127501, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 0, "サレン（サラサリア）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "るか", 0, 0, 0, "2030/12/31 15:00:00", 127601, 0, "2023/10/15 15:00:00", 127601, 127601, 157, 0, 0, 1.965, 4, 1, 0, 127601, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, "ルカ（サラサリア）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 6, 450, 0, "りんど", 0, 0, 0, "2030/12/31 15:00:00", 127701, 0, "2024/10/10 12:00:00", 127701, 127701, 693, 0, 0, 1.965, 48, 2, 0, 127701, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 0, "リンド");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "うるむ", 0, 0, 0, "2030/12/31 15:00:00", 127801, 0, "2024/10/18 12:00:00", 127801, 127801, 706, 0, 0, 1.965, 47, 2, 0, 127801, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 0, "ヴルム");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "ぺこりーぬ", 0, 0, 0, "2025/12/31 11:59:59", 127901, 1, "2025/12/21 12:00:00", 127901, 127901, 372, 0, 0, 1.965, 5, 2, 0, 127901, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 0, "ペコリーヌ（クリスマス）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 35, 450, 0, "くれじった", 0, 0, 0, "2030/12/31 15:00:00", 128001, 0, "2023/12/15 15:00:00", 128001, 128001, 723, 0, 0, 2.09, 35, 1, 0, 128001, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, "クレジッタ（クリスマス）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 0, 0, "しずる", 0, 181101, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 128101, 580, 0, 0, 0.0, 0, 0, 0, 128101, "", 1, "シズル（シズル&リノ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 0, 0, "りの", 0, 181101, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 128201, 580, 0, 0, 0.0, 0, 0, 0, 128201, "", 1, "リノ（シズル&リノ）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 3, 450, 0, "いのり", 0, 0, 0, "2030/12/31 15:00:00", 128301, 1, "2026/01/16 15:00:00", 128301, 128301, 191, 0, 0, 2.09, 38, 1, 0, 128301, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 0, "イノリ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "はつね", 0, 0, 0, "2026/01/31 11:59:59", 128401, 1, "2026/01/15 12:00:00", 128401, 128401, 801, 0, 0, 2.09, 21, 2, 0, 128401, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, "ハツネ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "かすみ", 0, 0, 0, "2026/01/31 11:59:59", 128501, 1, "2026/01/15 12:00:00", 128501, 128501, 739, 0, 0, 2.09, 21, 2, 0, 128501, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, "カスミ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, "りり", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 128601, 0, 0, 0, 0.0, 1, 0, 0, 128601, "", 0, "リリ（フォールン）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 450, 0, "ひより", 0, 0, 0, "2025/02/15 14:59:59", 128701, 1, "2025/02/10 12:00:00", 128701, 128701, 226, 0, 0, 2.09, 0, 1, 0, 128701, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, "ヒヨリ（アストラル）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1, 4, 450, 0, "れい", 0, 0, 0, "2030/12/31 15:00:00", 128801, 1, "2025/08/16 15:00:00", 128801, 128801, 194, 0, 0, 1.965, 0, 1, 0, 128801, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, "レイ（アストラル）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ゆい", 0, 0, 0, "2025/02/15 14:59:59", 128901, 1, "2025/02/10 12:00:00", 128901, 128901, 772, 0, 0, 2.09, 0, 2, 0, 128901, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, "ユイ（アストラル）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "えりす", 0, 0, 0, "2026/01/03 11:59:59", 129001, 1, "2025/12/31 12:00:00", 129001, 129001, 800, 0, 0, 2.09, 0, 2, 0, 129001, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, "エリス");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "ゆに", 0, 0, 0, "2025/03/15 14:59:59", 129301, 1, "2025/03/10 12:00:00", 129301, 129301, 708, 0, 0, 2.09, 7, 1, 0, 129301, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 0, "ユニ（ウィンター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 2, 450, 0, "くろえ", 0, 0, 0, "2030/12/31 15:00:00", 129401, 0, "2024/03/18 12:00:00", 129401, 129401, 188, 0, 0, 2.09, 2, 1, 0, 129401, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, "クロエ（ウィンター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 450, 0, "ちえる", 0, 0, 0, "2025/12/15 14:59:59", 129501, 1, "2025/11/30 12:00:00", 129501, 129501, 247, 0, 0, 2.09, 1, 1, 0, 129501, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 0, "チエル（ウィンター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 450, 0, "あねもね", 0, 0, 0, "2026/01/03 11:59:59", 129601, 1, "2025/12/31 12:00:00", 129601, 129601, 550, 0, 0, 2.09, 0, 1, 0, 129601, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, "アネモネ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 0, 450, 0, "ねふぃーねら", 0, 0, 0, "2026/01/03 11:59:59", 129701, 1, "2025/12/31 12:00:00", 129701, 129701, 540, 0, 0, 2.09, 0, 1, 0, 129701, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, "ネフィ＝ネラ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "まこと", 0, 0, 0, "2025/04/30 11:59:59", 129801, 1, "2025/04/26 12:00:00", 129801, 129801, 269, 0, 0, 2.09, 5, 1, 0, 129801, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 0, "マコト（コマンダー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 6, 450, 0, "えりこ", 0, 0, 0, "2030/12/31 15:00:00", 129901, 0, "2024/04/15 15:00:00", 129901, 129901, 294, 0, 0, 1.84, 48, 1, 0, 129901, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, "エリコ（コマンダー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 450, 0, "やまと", 0, 0, 0, "2025/11/14 14:59:59", 130001, 1, "2025/11/03 12:00:00", 130001, 130001, 150, 0, 0, 2.09, 0, 1, 0, 130001, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 0, "ヤマト");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "わかな", 0, 0, 0, "2025/11/14 14:59:59", 130101, 1, "2025/11/03 12:00:00", 130101, 130101, 535, 0, 0, 2.09, 9, 1, 0, 130101, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 0, "ワカナ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 450, 0, "ふぶき", 0, 0, 0, "2025/11/14 14:59:59", 130201, 1, "2025/11/03 12:00:00", 130201, 130201, 371, 0, 0, 1.84, 0, 1, 0, 130201, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 0, "フブキ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 4, 0, 0, "れい", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 130601, 0, 0, 0, 0.0, 1, 0, 0, 130601, "", 0, "レイ（アストラル）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "きょうか", 0, 0, 0, "2025/05/15 14:59:59", 130701, 1, "2025/05/03 19:00:00", 130701, 130701, 563, 0, 0, 1.92, 7, 2, 0, 130701, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 0, "キョウカ（スプリング）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "すずめ", 0, 0, 0, "2030/12/31 15:00:00", 130801, 0, "2024/05/15 15:00:00", 130801, 130801, 558, 0, 0, 1.84, 7, 2, 0, 130801, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, "スズメ（スプリング）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "くるる", 0, 0, 0, "2030/12/31 15:00:00", 130901, 0, "2024/06/15 15:00:00", 130901, 130901, 440, 0, 0, 2.09, 7, 2, 0, 130901, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, "クルル");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "まほ", 0, 0, 0, "2025/06/20 11:59:59", 131001, 1, "2025/06/10 12:00:00", 131001, 131001, 702, 0, 0, 1.84, 7, 2, 0, 131001, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 0, "マホ（ドリームパーク）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 2, 450, 0, "ねあ", 0, 0, 0, "2030/12/31 15:00:00", 131101, 0, "2024/06/30 12:00:00", 131101, 131101, 165, 0, 0, 2.09, 52, 1, 0, 131101, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, "ネア（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 54, 450, 0, "みそら", 0, 0, 0, "2025/07/23 11:59:59", 131201, 1, "2025/07/10 12:00:00", 131201, 131201, 753, 0, 0, 2.09, 54, 2, 0, 131201, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 0, "ミソラ（サマー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, "りり", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 131301, 0, 0, 0, 0.0, 1, 0, 0, 131301, "", 1, "リリ");
