INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 8, 450, 0, "にのん", 0, 0, 0, "2030/12/31 15:00:00", 137101, 0, "2025/08/15 15:00:00", 137101, 137101, 566, 0, 0, 2.09, 47, 2, 0, 137101, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 0, "ニノン（サマー）");
