INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "かすみ", 0, 0, 0, "2025/11/14 14:59:59", 137401, 1, "2025/11/03 12:00:00", 137401, 137401, 688, 0, 0, 2.09, 21, 2, 0, 137401, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", 0, "カスミ（シスター）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, "あいら", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 137501, 0, 0, 0, 0.0, 1, 0, 0, 137501, "", 0, "アイラ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 450, 0, "こっころ", 0, 0, 0, "2026/01/03 11:59:59", 137601, 1, "2025/12/31 12:00:00", 137601, 137601, 733, 0, 0, 2.09, 0, 2, 0, 137601, "【魔法】後衛で、主さまを想い“進化”した嚮導の巫女。\n極大ダメージのＵＢで敵を穿ち、【進化超越】の権能によ\nって、味方のバフやダメージを、限界を超え成長させる。", 0, "コッコロ（嚮導幼君）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 0, 0, "ゆきの", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 137801, 0, 0, 0, 0.0, 1, 0, 0, 137801, "", 0, "ユキノ");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 8, 450, 0, "りの", 0, 0, 0, "2026/01/31 11:59:59", 137901, 1, "2026/01/15 12:00:00", 137901, 137901, 684, 0, 0, 2.09, 8, 2, 0, 137901, "【魔法】後衛で絵馬に込めた想いを胸に抱く晴れ着の妹。\nクリティカル時に威力が上がる矢で敵を撃ち抜き、味方\n全体への攻撃支援や継続ＴＰ回復で厄を払い福を届ける。", 0, "リノ（ニューイヤー）");
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, "さくら", 0, 0, 0, "2030/12/31 15:00:00", 0, 1, "2015/04/01 15:00:00", 0, 138601, 0, 0, 0, 0.0, 1, 0, 0, 138601, "", 0, "サクラ");
